        id SERIAL PRIMARY KEY,
        parcel_id TEXT,
        sheet_id TEXT,
        area_sqm NUMERIC,
        geom GEOMETRY,
        valid_from DATE,
        valid_to DATE,
        last_updated DATE
      );

